    line-height: 1.6;">THE ATOM. MODELS OF THE ATOM.<br/><br/>Do you like mysteries? Are you curious? Humans are curious. Someone always<br/>wants to know something that is not easy to detect or to see what can’t be seen.<br/>For example, people began wondering about matter more than 2500 years ago.<br/>Some of the early philosophers thought that matter was composed of tiny<br/>particles. They reasoned that you could take a piece of matter, cut it in half, cut<br/>the half piece in half again, and continue to cut again and again. Eventually, you<br/>wouldn’t be able to cut any more. You would have only one particle left. They<br/>named these particles atoms, a term that means “cannot be divided”.<br/>Describing the unseen.<br/>Early philosophers didn’t try to prove their theories by doing experiments as<br/>scientists now do. Their theories were the result of reasoning, debating, and<br/>discussion, not of evidence or proof. Today, scientists will not accept a theory<br/>that is not supported by experimental evidence. But even if these philosophers<br/>had experimented, they could not have proven the existence of atoms. The kind<br/>of equipment needed to study matter was a long way from being invested. Even<br/>as recently as 500 years ago, atoms were still a mystery.<br/>In 1800, Dalton proposed a modern atomic model based on experimentation.<br/>This theory can be summarized in:<br/> All matter is made of atoms. Atoms are indivisible and indestructible.<br/> All atoms of a given element are identical in mass and properties.<br/> Each element has different atoms.<br/> Compounds are formed by a combination of two or more different kinds<br/>of atoms<br/> Atoms are rearranged in reactions.<br/>Thomson’s atomic model.<br/>Thomson revised Dalton’s model of the atom and did some experiments using<br/>metals and different gases in a tube. He found that some charged particles<br/>were produced no matter what<br/>elements were used for the metal or<br/>the gas in the tube. Thomson<br/>concluded that the rays were<br/>negatively charged particles of<br/>matter. How did Thomson know the<br/>particles were negatively charged?<br/>He knew that opposite charges<br/>attract to each other. He observed<br/>that these particles were attracted<br/>to the positively charged<br/>electrode, so he reasoned that the<br/><br/>particles must be negatively charged.<br/>These negatively charged particles are now called electrons. Thomson also<br/>inferred that electrons are a part of every kind of atom because they are<br/>produced by every kind of metal. Perhaps the biggest surprise that came<br/>from Thomson’s experiments was the evidence that particles smaller than<br/><br/>1<br/><br/>the atom do exist. Based on this discovery, Thomson proposed his own model<br/>of the atom in which he pictured the atom as a watermelon where the red part,<br/>the fleshy part will be the positive charge. The negatively charged particles<br/>were spread evenly among the positive charge, as are seeds inside the<br/>watermelon. The positive charge is equal to the negative charge. Therefore,<br/>the atom is neutral. It was later discovered that not all atoms are neutral<br/>because the number of negative charges within an element can vary.<br/>Rutherford’s experiments.<br/>A model is not accepted in the scientific community until it has been tested and<br/>the tests support previous observations. In 1906 Ernest Rutherford and his<br/>coworkers began an experiment to find out if Thomson’s model of the atom was<br/>correct. They wanted to see what would happen when they fired fast-moving,<br/>positively charged bits of matter, called alpha particles, at a thin film of a metal<br/>such as gold. Alpha particles, which come from unstable atoms, are positively<br/>charged.<br/><br/>The figure shows how<br/>the experiment was set<br/>up. A source of alpha<br/>particles was aimed at<br/>a thin sheet of gold foil.<br/>The foil was surrounded<br/>by a fluorescent screen<br/>that gave a flash of light<br/>each time it was hit by a<br/>charged particle.<br/>Rutherford ́s prediction<br/>was that most of the<br/>speeding alpha particles would pass right through the foil and hit the screen on<br/>the other side, just like a bullet fired through a pane of glass. Rutherford<br/>reasoned that the thin, gold film did not contain enough matter to stop the<br/>speeding alpha particle or change its path.<br/>Rutherford was shocked when the student who was controlling the experiment<br/>rushed in to tell him that some alpha particles sere veering off at large angles.<br/>Rutherford expressed his amazement by saying, “It was about as believable as<br/>if you had fired a 15-inch shell at a piece of tissue paper, and it came back and<br/>hit you”. How could such an event be explained? The positively charged alpha<br/>particles were moving with such high speed that it would take a large positive<br/>charge to cause them to bounce back. Now Rutherford and his team had to<br/>come up with an explanation for these unexpected results. Now and then, an<br/>alpha particle might be affected slightly by a positive charge in the atom and<br/>turn a bit off course. However, large changes in direction were not expected.<br/>The actual results did not fit this model so Rutherford proposed a new one.<br/>He hypothesized that almost all the mass of the atom and all of its positive<br/>charge are crammed into an incredibly small region of space at the center<br/>of the atom called the nucleus. Eventually, his prediction was proved true. In<br/>1920 scientists identified the positive charges in the nucleus as protons. A<br/>proton is a positively charged particle present in the nucleus of all atoms. The<br/><br/>2<br/><br/>rest of each atom is empty space occupied by the atoms almost mass less<br/>electrons.<br/>Rutherford’s new model of the atom fitted the experimental data. Most alpha<br/>particles could move through the foil with little or no interference because of the<br/>empty space that makes up most of the atom. However if an alpha particle<br/>made a direct hit on the nucleus of a gold atom, which has 79 protons, the<br/>alpha particle would be strongly repelled and bounce back.<br/>Rutherford’s nuclear model was applauded as other scientists reviewed the<br/>results of the experiments. However, some data didn’t fit. Once again, more<br/>questions arose and the scientific process continued. For instance, atom’s<br/>electrons have almost no mass. According to Rutherford’s model, the only other<br/>particle in the atom was the proton. That meant that the mass of an atom should<br/>have been approximately equal to the mass of its protons. However, it wasn’t.<br/>The mass of most atoms is at least twice as great as the mass of its protons.<br/>That left scientist with a dilemma and raised a new question. Where does the<br/>extra mass come from if only protons and electrons made up the atom?<br/>Furthermore, it seemed pretty stressed to queue up 70, 80 or more protons in<br/>such a tiny space (the nucleus) and don ́t expect some kind of tightness. So<br/>many positives charges in a very small placed didn ́t seem to be the perfect<br/>place for the protons; but it was. Some idea came to mind: what if the protons<br/>were not the only particles present in the atom ́s nucleus? Could it be that<br/>another particle could accompany protons and stabilize them? For that purpose<br/>this “magical” particle should be neutral (no repulsion, no attraction) and as said<br/>before, have mass.<br/>It was proposed that another particle must be in the nucleus to account<br/>for the extra mass. The particle, which was later called the neutron, would<br/>have the same mass as a proton and be<br/>electrically neutral. Proving the existence of<br/>neutrons was difficult though, because a<br/>neutron has no charge. It took another 20<br/>years before scientists were able to show by<br/>more modern experiments that atoms contain<br/>neutrons.<br/>The model of the atom was revised again to<br/>include the newly discovered neutrons in the<br/>nucleus. The nuclear atom has a tiny<br/>nucleus, tightly packed with positively<br/>charged protons and neutral neutrons.<br/>Negatively charged electrons occupy the space surrounding the nucleus.<br/>The number of electrons in a neutral atom equals the number of protons<br/>in the atom.<br/>Bohr ́s atomic model.<br/>Rutherford ́s model seemed to have some flaws, as said before. More<br/>miscalculations were found later; the first one was related to the “eternal”<br/>movement of the electron around the nucleus that he proposes. Scientists knew<br/>that charged particles could not be moving for ever; eventually they would lose<br/><br/>3<br/><br/>all the energy available and collapse agains the nucleus. That wasn ́t the case,<br/>so, the electron was not moving constantly as Rutherford proposed.<br/>The movement of the electron was tricky to understand, but the development of<br/>an equipment called spectrograph came quite handy. The spectrograph made a<br/>drawing (spectrum) in which each movement of the electron could be shown as<br/>a line. If the movement of the electron<br/>was as Rutherford supposed, endless,<br/>the spectrum of the electron ́s movement<br/>would be completely black; each<br/>movement supposes a line, infinite<br/>movements will outcome a black<br/>spectrum. But, as scientists proved later,<br/>the spectrum was not black; it showed<br/>independent lines at specific<br/>distances.<br/><br/>Trying to explain this strange phenomenon, Niels Bohr, a Danish scientist,<br/>theorized that electrons absorb energy and move to higher energy states.<br/>Then, these excited electrons give off that energy as light waves when they<br/>fall back to a lower energy state. But, why were only certain lines of light<br/>given off and not others? To answer this question, Bohr suggested that<br/>electrons could have only certain amounts of energy, due to the position<br/>they have inside the atom. When they absorb energy, electrons absorb only<br/>the amount needed to move to a specific higher energy state. Then, when the<br/>electrons fall back to a lower energy state, they emit only certain amounts of<br/>energy.<br/>Look carefully to the following drawing to better understand Bohr ́s idea about<br/>the electron ́s location inside the atom.<br/>Because electrons can have only certain<br/>amounts of energy, Bohr reasoned than they<br/>can move around the nucleus only at distances<br/>that correspond to those amounts of energy.<br/>These regions of space in which electrons can<br/>move about the nucleus of an atom are called<br/>energy levels. Each energy level can hold a<br/>limited number of electrons. The lowest energy<br/>level is the smallest, the more comfortable for<br/>the electrons and the closest to the nucleus.<br/>Identifying characteristics.<br/>Each chemical element is different and has unique properties. These<br/>differences can be described in part by looking at the relationships between the<br/>atomic particles in each element. The periodic table contains numbers that<br/>describe these relationships.<br/>Number of protons and neutrons.<br/>Look up the element chlorine on the periodic table. Cl is the symbol for chlorine,<br/>but what are the two numbers, above and below the symbol? The top number is<br/>the element’s atomic number. It tells you the number of protons in the nucleus<br/>of each atom of that element. Every atom of chlorine, for example, has 17<br/>protons in its nucleus. This number is identified as Z.<br/><br/>4<br/><br/>Isotopes.<br/>Although the number of protons changes from element to element, every atom<br/>of the same element has the<br/>same number of protons.<br/>However, the number of<br/>neutrons can vary even for<br/>one element. For example,<br/>some chlorine atoms have 18<br/>neutrons in their nucleus while<br/>others have 20. These two<br/>types of chlorine atoms are<br/>chlorine-35 and chlorine-37.<br/>They are called isotopes,<br/>which are atoms of the<br/><br/>same element that have different numbers of neutrons.<br/>You can tell someone exactly which isotope you are referring to by using its<br/>mass number. An atom’s mass number is the number of protons plus the<br/>number of neutrons it contains. The numbers 35 and 37, which were used to<br/>refer to chlorine, are mass numbers and they are identified by the letter A.<br/>Hydrogen has three isotopes with mass numbers of 1, 2 and 3. Each hydrogen<br/>atom always has one proton, but in each isotope the number of neutrons is<br/>different.<br/><br/>So, Z= no of protons; A= no of protons + no of neutrons.<br/><br/>Ions.<br/>An atom or molecule which has gained or lost one or more of its electrons is no<br/>longer neutral. It becomes a<br/>charged particle called an ion.<br/>If an atom has lost electrons,<br/>then that atom has more<br/>protons than electrons and its<br/>charge is positive. We call it a<br/>cation. If an atom gains<br/>negative charge, electrons,<br/>then it has more electrons<br/>than protons so its charge is negative. We call it an anion.<br/>Radioactivity.<br/><br/>Unstable atomic nuclei will<br/>spontaneously decompose to form<br/>nuclei with higher stability. The<br/>decomposition process is called<br/>radioactivity. The energy and<br/>particles which are released during<br/>the decomposition process are<br/>called radiation.<br/>Radioactivity releases a great<br/>amount of energy because part of nuclear mass becomes energy (E=mc2<br/>).<br/><br/>5<br/><br/>There are three types of radiations:<br/> Alpha radiations (α): it consists of a stream of positively charged<br/>particles which have an atomic mass of four and a charge of +2 (a<br/>helium nucleus).<br/> Beta radiation (β): it is a stream of electrons.<br/> Gamma radiation (γ): it is a stream of high-energy photons. These<br/>emissions results from an energy change within the atomic nucleus. This<br/>radiation changes neither the atomic number nor the atomic mass.<br/>A huge amount of energy can be obtained by transforming small amounts of<br/>matter into energy. There are two methods:<br/> Nuclear fission. A heavy nucleus (uranium, plutonium, etc.) splits into<br/>several smaller fragments. These fragments or fission products are about<br/>equal to half the original mass. Two or three neutrons are also emitted.<br/>This fact can made possible a chain reaction with an unprecedented<br/>energy yield.<br/> Advantages: the fission process has high energy efficiency;<br/>1kg of uranium produces as much energy as 2000 tons of oil.<br/> Disadvantages. It presents risk of radioactive contamination<br/>and it is difficult to eliminate waste.<br/><br/> Nuclear fusion: it joins two light elements (usually hydrogen) forming a<br/>more massive element (helium) releasing a tremendous amount of<br/>energy in the process. It has been used as bomb. Nowadays its peaceful<br/>use is being researched.<br/> Advantages: a lot more energy than fission can be obtained.<br/>There are large reserves of energy (hydrogen from ocean<br/>water) and it almost does not produce waste or polluting<br/>substances.<br/> Disadvantages: it is necessary an extremely high temperature<br/>to start the nuclear reaction (lasers are used to reach this<br/>temperatures). Magnetic fields are used to keep this matter in a<br/>determine space. All these processes are being researched.<br/><br/>Applications of radioactivity and radioisotopes.<br/>Radioactive isotopes, called radioisotopes, are not always harmful; they find<br/>numerous uses in different areas such as medicine, chemistry, biology,<br/>archaeology, agriculture, industry and engineering.<br/>Determination of age of minerals and rocks and archaeological objects:<br/>many minerals contain radioactive isotopes. The age of any of these minerals<br/>can be determined by counting the isotopes in the mineral and using the known<br/>decay rate to calculate the time required in that process. Example: radiocarbon<br/>dating (14C).<br/>Medicine: sterilization of surgical equipment, cancer treatment and study or<br/>organs, forensic investigations, etc.<br/>Industry: X rays to examine steel plates, welding and construction.<br/><br/>6<br/><br/>Scientific research and experiments: to study reaction mechanisms and<br/>chemical manufacturing.<br/>Other uses: auxiliary generator for satellites, precision clocks, sterilization of<br/>agricultural pets, etc. resumelo con todos los datos</div><br/><br/>LLM response:<br/><div style="
