    margin: 10px 0;
    border-radius: 5px;
    line-height: 1.6;"><p>The concept of atoms was introduced by early philosophers over 2500 years ago, but it was not until 1800 that Dalton proposed a modern atomic model based on experimentation. Thomson later discovered electrons and proposed a model of the atom that included a positively charged nucleus. Rutherford continued to refine the atomic model and found that the nucleus had protons, positively charged particles, and neutrons which are electrically neutral particles. Bohr's atomic model suggested that electrons occupy specific energy levels and could only absorb and release energy in specific amounts. Radioactivity, the decomposition of unstable atomic nuclei, releases a tremendous amount of energy and can occur through alpha, beta, or gamma radiation. Radioactive isotopes have numerous practical applications, such as determining the age of minerals or rocks, in medicine, industry, scientific research, and more.</p></div>

