    line-height: 1.6;"><p>To implement the <code>findSmallestSums</code> function, we need to generate all possible pairs between list A and list B, calculate their combined intensities, sort the pairs by combined intensity as the primary key and individual intensities as secondary keys, and then return the first K pairs.</p>
<p>Here's how you can implement this function in Java:</p>
<pre><code class="language-java">import java.util.List;
import java.util.ArrayList;
import java.util.PriorityQueue;

class Pair implements Comparable&lt;Pair&gt; {
    int a;
    int b;
    int sum;

    public Pair(int a, int b) {
        this.a = a;
        this.b = b;
        this.sum = a + b;
    }

    @Override
    public int compareTo(Pair other) {
        if (this.sum != other.sum) {
            return Integer.compare(this.sum, other.sum);
        } else if (this.a != other.a) {
            return Integer.compare(this.a, other.a);
        } else {
            return Integer.compare(this.b, other.b);
        }
    }
}

public class Main {
    public static List&lt;List&lt;Integer&gt;&gt; findSmallestSums(List&lt;Integer&gt; A, List&lt;Integer&gt; B, int K) {
        List&lt;List&lt;Integer&gt;&gt; result = new ArrayList&lt;&gt;();
        PriorityQueue&lt;Pair&gt; queue = new PriorityQueue&lt;&gt;();

        // Generate all possible pairs
        for (int i = 0; i &lt; A.size(); i++) {
            for (int j = 0; j &lt; B.size(); j++) {
                queue.add(new Pair(A.get(i), B.get(j)));
            }
        }

        // Retrieve first K pairs with smallest sums
        for (int i = 0; i &lt; K; i++) {
            Pair p = queue.poll();
            if (p != null) {
                List&lt;Integer&gt; pair = new ArrayList&lt;&gt;();
                pair.add(p.a);
                pair.add(p.b);
                result.add(pair);
            }
        }

        return result;
    }

